import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Profile.css';

function Profile() {
  const [history, setHistory] = useState([]);
  const [errorMessage, setErrorMessage] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');
    const sessionId = localStorage.getItem('sessionId');

    if (!token && !sessionId) {
      setErrorMessage('You need to log in to view your profile.');
      return;
    }

    axios
      .post(
        'http://localhost:8080/diagnosis-history',
        { token, sessionId },
        { withCredentials: true }
      )
      .then((response) => {
        if (response.data.success) {
          setHistory(response.data.history);
        } else {
          setErrorMessage(response.data.message);
        }
      })
      .catch(() => {
        setErrorMessage('Failed to load diagnosis history.');
      });
  }, []);

  return (
    <div className="profile">
      <div className="profile-header">
        <h1>Your Profile</h1>
        <p>View your diagnosis results with rich visual effects.</p>
      </div>

      {errorMessage && <p className="error-message">{errorMessage}</p>}

      <div className="history-container">
        {history.length > 0 ? (
          history.map((item, index) => (
            <div className="history-card" key={index}>
              <div className="card-content">
                <h3 className="disease-name">{item.diseaseName}</h3>
                <img
                  className="disease-image"
                  src={item.imageUrl}
                  alt={item.diseaseName}
                />
              </div>
            </div>
          ))
        ) : (
          <p className="no-history">No diagnosis history found.</p>
        )}
      </div>
    </div>
  );
}

export default Profile;
